import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';

function Monetization() {
  return (
    <Container maxWidth="md" sx={{ paddingY: 5 }}>
      <Box sx={{ textAlign: 'center', marginBottom: 4 }}>
        <Typography variant="h4" sx={{ color: '#132a47', fontWeight: 'bold' }}>
          Earn Big with Every Catch
        </Typography>
        <Typography variant="body1" sx={{ color: '#4a4a4a', marginBottom: 4 }}>
          Enter tournaments, catch the winning fish, and take home the prize pool.
        </Typography>
        <Button variant="contained" sx={{ backgroundColor: '#d6b98d', color: '#132a47' }}>
          Get Started
        </Button>
      </Box>
    </Container>
  );
}

export default Monetization;
